    flex: 1,
    flexDirection: "column"
  },
  ViewDate: {
    flex: 1,
    flexDirection: "row",
    height: 40
  },
  textDate: {
    paddingTop: 10,
    color: colors.white,
    fontSize: 14,
    fontWeight: '500'
  },
  information: {
    flex: 9,
    flexDirection: "column",
    height: 290
  },
  shareInformation: {
    flex: 4.75,
    flexDirection: "row"
  },
  headerInformation: {
    color: colors.white,
    fontSize: 14,
    fontWeight: '500',
    textAlign: "center",
    padding: 12
  },
  numInformation: {
    color: colors.white,
    fontSize: 16,
    fontWeight: '500',
    textAlign: "center",
    justifyContent: 'center',
    marginRight: 8,
    maxWidth: '80%'
  },
  itemRevenue: {
    flexDirection: 'row',
    alignItems: 'center',
    alignSelf: 'center'
  },
  dayInformation: {
    color: colors.colorLine,
    fontSize: 12,
    fontWeight: '500',
    textAlign: "center",
    paddingTop: 4
  },
  rowInformation: {
    flex: 4.75,
    backgroundColor: colors.grayLight,
    borderRadius: 4
  },
  iconInformation: {},
  listPicker: {
    zIndex: 5,
    position: 'absolute',
    backgroundColor: colors.grayLight,
    borderRadius: 4,
    borderColor: colors.backgroundApp,
    paddingHorizontal: 7,
    paddingVertical: 5,
    height: 275,
    top: 60
  },
  listPickerYear: {
    zIndex: 5,
    position: 'absolute',
    backgroundColor: colors.grayLight,
    borderRadius: 4,
    borderColor: colors.backgroundApp,
    paddingHorizontal: 7,
    paddingVertical: 5,
    height: 180,
    top: 45
  },
  itemPicker: {
    height: 30,
    justifyContent: "center"
  },
  textItemPicker: {
    color: colors.colorText
  }
});

